const String wordTable = """CREATE TABLE IF NOT EXISTS "Word" (
"wordID"	INTEGER,
"Name" TEXT,
"PictureSrc"	TEXT,
"AudioSrc"	TEXT,
"isPronounced"	INTEGER,
"PronunciationScore"	NUMERIC,
"Reward"	INTEGER,
"categoryID"	INTEGER,
"IsNew" INTEGER,
"IsDeleted" INTEGER,
PRIMARY KEY("wordID" AUTOINCREMENT)
);""";
const String categoryTable = """CREATE TABLE IF NOT EXISTS "Category" (
"ID"	INTEGER,
"Name"	TEXT,
"isCompleted"	INTEGER,
"PictureSrc"	TEXT,
"Reward"	INTEGER,
"IsNew" INTEGER,
"IsDeleted" INTEGER,
PRIMARY KEY("ID" AUTOINCREMENT)
);""";

const String gameTable = """CREATE TABLE IF NOT EXISTS "Game" (
"GameID"	INTEGER,
"Name"	TEXT,
"Type"	INTEGER,
"Reward"	INTEGER,
"PictureSrc"	TEXT,
PRIMARY KEY("GameID" AUTOINCREMENT)
);""";

const String userTable = """CREATE TABLE IF NOT EXISTS "User" (
"UserID"	INTEGER,
"Name"	TEXT,
"Surname"	TEXT,
"Age"	INTEGER,
"Coin"	INTEGER,
PRIMARY KEY("UserID" AUTOINCREMENT)
);""";

const String GameUserTable = """CREATE TABLE IF NOT EXISTS "GameUser" (
"UserID"	INTEGER,
"GameID"	INTEGER,
"Score" FLOAT,
"Date"  TEXT,
"Timetaken" INTEGER,
"IsFinished" BOOLEAN,
FOREIGN KEY (UserID) REFERENCES User(UserID),
FOREIGN KEY (GameID) REFERENCES Game(GameID)
);""";

const String contentTable = """CREATE TABLE IF NOT EXISTS "Content" (
"ID"	INTEGER,
"Name" TEXT,
"PictureSrc"	TEXT,
"isPurchased" BOOLEAN,
"inUsed" BOOLEAN,
"Price"	INTEGER,
"Category"	INTEGER,
PRIMARY KEY("ID" AUTOINCREMENT)
);""";

const String pronunciationTable =
    """CREATE TABLE IF NOT EXISTS "Pronunciation" (
"ID"	INTEGER,
"WordID"	INTEGER,
"CategoryID" INTEGER,
"Date"  TEXT,
"Score" FLOAT,
PRIMARY KEY("ID" AUTOINCREMENT),
FOREIGN KEY (WordID) REFERENCES Word(wordID),
FOREIGN KEY (CategoryID) REFERENCES Category(ID)
);""";

